import "../../App.css";
import Header from '../header/Header';
import Footer from '../footer/Footer';
import ScrollUp from '../scrollup/ScrollUp';

const PeakGradScheme = () => {
    return (
      <>
      <Header />
  
      Peak Grad Scheme Page.
  
      <Footer />
      <ScrollUp />
      </>
    );
  };


export default PeakGradScheme
